import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

function Read() {

  const {id} = useParams();
  const [student, setStudent] = useState([])

  useEffect(() => {
    axios.get('http://localhost:8081/read/'+id)
    .then(res => {
       console.log(res);
       setStudent(res.data);
    })
    .catch(err => console.log(err));
  }, [])
  return (
    <div>
      <h1>Read</h1>
    </div>
  )
}

export default Read
